  [],\n\t\"revision_timestamp\": \"2016-02-03T02:45:58.348798\",\n\t\"name\": \"polygon-boundaries-for-source-data-of-a-continuous-terrain-model-for-water-circulation-studi-84\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Water quality in the Barnegat Bay estuary
  along the New Jersey coast is the focus of a multidisciplinary research project
  begun in 2011 by the U.S. Geological Survey (USGS) in cooperation with the New Jersey
  Department of Environmental Protection. This narrow estuary is the drainage for
  the Barnegat Bay watershed and flushed by just three inlets connecting it to the
  Atlantic Ocean, is experiencing degraded water quality, algal blooms, loss of seagrass,
  and increases in oxygen-depletion events. The scale of the estuary and the scope
  of the problems within it required a regional approach to understand and model water
  circulation within the bay and adjacent ocean. A continuous elevation surface (terrain
  model) integrating all available elevation data in the area was produced for the
  water circulation modeling efforts.\",\n\t\"license_title\": null,\n\t\"extras\":
